let documentoPrueba = document.getElementById('documentoPrueba');
let documentoPruebaFloat2 = document.getElementById('documentoPruebaFloat');
let unidadActual = documentoPrueba.getAttribute('unidadButton');
console.log('unidadActual: ', unidadActual);

documentoPrueba.addEventListener('click', () => {
    if(localStorage.getItem('nombreAlumno') == "" || localStorage.getItem('grupoAlumno') == ""){
        M.toast({html: `Falta su nombre o grupo`});
    }else{
        crearPdf();
    }
})

documentoPruebaFloat2.addEventListener('click', () => {
    if(localStorage.getItem('nombreAlumno') == "" || localStorage.getItem('grupoAlumno') == ""){
        M.toast({html: `Falta su nombre o grupo`});
    }else{
        crearPdf();
    }
 })
 

function crearPdf(){
     //Crear el documento [high, wide]
     const pageAltura = 279; 
     const pageAncho = 216;
     var doc = new jsPDF('p', 'mm', [pageAltura,pageAncho]);
 
     //Se valida la unidad actual para elegir los textos y los colores
     let tituloPDF = '';
     let colorOnePDF = [];
     let colorTwoPDF = [];
     let colorThreePDF = [];
 
     //Se crea la variable donde se almacenaran los intentos
     let intentosFinalValidado = "";
 
     //Titulo de la unidad para el archivo de PDF
     let tituloUnidadArchivoFinal = "resultados_cuestionario_";
 
     if(unidadActual == 'u1'){
 
         tituloPDF = 'Unidad 1: Título de la unidad con un texto largo de prueba';
         colorOnePDF = [61, 81, 71];
         colorTwoPDF = [85, 112, 99];
         colorThreePDF = [109, 142, 126];
 
         intentosFinalValidado = localStorage.getItem('intentosU1');
 
         tituloUnidadArchivoFinal += "unidad_1";
 
     }else if(unidadActual == 'u2'){
 
         tituloPDF = 'Unidad 2: Título de la unidad con un texto largo de prueba';
         colorOnePDF = [128, 84, 88];
         colorTwoPDF = [160, 104, 110];
         colorThreePDF = [205, 140, 146];
 
         intentosFinalValidado = localStorage.getItem('intentosU2');
 
         tituloUnidadArchivoFinal += "unidad_2";
 
     }else if(unidadActual == 'u3'){
 
         tituloPDF = 'Unidad 3: Título de la unidad con un texto largo de prueba';
         colorOnePDF = [116, 84, 116];
         colorTwoPDF = [153, 109, 153]; 
         colorThreePDF = [181, 131, 181];
 
         intentosFinalValidado = localStorage.getItem('intentosU3');
 
         tituloUnidadArchivoFinal += "unidad_3";
 
     }else if(unidadActual == 'u4'){
 
         tituloPDF = 'Unidad 4: Título de la unidad con un texto largo de prueba';
         colorOnePDF = [172, 101, 93];
         colorTwoPDF = [214, 124, 114];
         colorThreePDF = [232, 151, 142];
 
         intentosFinalValidado = localStorage.getItem('intentosU4');
 
         tituloUnidadArchivoFinal += "unidad_4";
 
     }else if(unidadActual == 'u5'){
 
         tituloPDF = 'Unidad 5: Título de la unidad con un texto largo de prueba';
         colorOnePDF = [120, 129, 158];
         colorTwoPDF = [145, 155, 189];
         colorThreePDF = [174, 185, 218];
 
         intentosFinalValidado = localStorage.getItem('intentosU5');
 
         tituloUnidadArchivoFinal += "unidad_5";
 
     }
 
     /////////////////////////////////////////////
     //PAGINA 1
     ////////////////////////////////////////////
 
     //Para que la imagen funcione debe presionar ALT + Z para que todo este en una linea.
     var iconoIpn = 'data:image/png;base64,'
     var iconoEscom = 'data:image/png;base64,'
     
     ////////////////////////////////////////////////
     //Funcion para meter el encabezado
     function encabezado(){
         //Rectangulo para el logo del poli
         doc.setDrawColor(0);
         doc.setFillColor(colorOnePDF[0],colorOnePDF[1],colorOnePDF[2]);
         doc.roundedRect(0, 0, pageAncho, 25, 0, 0, 'F');
 
         doc.addImage(iconoEscom, 'png', 190, 5, 18, 16);
         doc.addImage(iconoIpn, 'png', 8, 3, 15, 19);
     
         //Nombre del IPN y de la ESCOM
         doc.setTextColor(255,255,255);
         doc.setFont("helvetica");
         doc.setFontType("bold");
         doc.setFontSize(22);
         doc.text(53, 12, 'Instituto Politécnico Nacional');
         doc.setFontType("normal");
         doc.setFontSize(14);
         doc.text(63, 20, 'Escuela Superior de Cómputo ESCOM');
         
         //Rectangulo para decoracion del rectangulo del encabezado
         doc.setDrawColor(0);
         doc.setFillColor(colorTwoPDF[0],colorTwoPDF[1],colorTwoPDF[2]);
         doc.roundedRect(0, 25, pageAncho, 5, 0, 0, 'F');
     
         doc.setDrawColor(0);
         doc.setFillColor(colorThreePDF[0],colorThreePDF[1],colorThreePDF[2]);
         doc.roundedRect(0, 30, pageAncho, 5, 0, 0, 'F');
 
         //Rectangulo para el pie de página
         doc.setDrawColor(0);
         doc.setFillColor(colorTwoPDF[0],colorTwoPDF[1],colorTwoPDF[2]);
         doc.roundedRect(0, pageAltura-3, pageAncho, 3, 0, 0, 'F');
 
         doc.setDrawColor(0);
         doc.setFillColor(colorThreePDF[0],colorThreePDF[1],colorThreePDF[2]);
         doc.roundedRect(0, pageAltura-6, pageAncho, 3, 0, 0, 'F');
     }
 
     encabezado(altura = 0); //pag uno
 
     ////////////////////////////////////////////////////////////////////////////
     //Encabezado para el titulo de la unidad
     ////////////////////////////////////////////////////////////////////////////
 
     //Rectangulo para el titulo
     doc.setDrawColor(0);
     doc.setFillColor(238,238,238);
     doc.roundedRect(0, 35, pageAncho, 40, 0, 0, 'F');
 
     //Datos de la unidad
     doc.setTextColor(colorOnePDF[0],colorOnePDF[1],colorOnePDF[2]);
     doc.setFont("helvetica");
     doc.setFontType("bold");
     doc.setFontSize(25);
     doc.text(10, 52, 'Recurso didáctico digital');
     doc.setTextColor(colorTwoPDF[0],colorTwoPDF[1],colorTwoPDF[2]);
     doc.setFontType("bold");
     doc.setFontSize(16);
     doc.text(10, 62, tituloPDF);
 
     ////////////////////////////////////////////////////////////////////////////
     //Estadísticas del usuario
     ////////////////////////////////////////////////////////////////////////////
     
     //Rectangulo para el contenido del esta sección
     doc.setDrawColor(0);
     doc.setFillColor(225,225,225);
     doc.roundedRect(10, 85, 195, 140, 5, 5, 'F');
     
     //Rectangulo para el titulo
     doc.setDrawColor(0);
     doc.setFillColor(210,210,210);
     doc.roundedRect(10, 85, 195, 25, 5, 5, 'F');
     
     //Titulo de la sección
     doc.setTextColor(70,70,70);
     doc.setFontSize(20);
     doc.text(35, 100, 'Resultado del cuestionario');
 
     
     //Icono para el titulo
     let iconoSeccionResultados = 'data:image/png;base64,';
     doc.addImage(iconoSeccionResultados, 'png', 20, 92, 12, 12);
 
     //Contenido de la sección (Datos generales del cuestionario)
     doc.setTextColor(0);
     doc.setFont("helvetica");
     doc.setFontSize(16);
     doc.text(35, 121.5, 'Nombre: ' + localStorage.getItem('nombreAlumno'));
     doc.text(35, 131.5, 'Grupo: ' + localStorage.getItem('grupoAlumno'));
     doc.text(35, 151.5, 'Preguntas correctas: ' + puntajeTotal + '/20');
     doc.text(35, 151.5, 'Preguntas correctas: ' + puntajeTotal + '/20'); //Puntaje total es una variable global de evaluacion_unidad.js
     doc.text(35, 151.5+10, 'Tiempo de respuesta: ' + horas + ":" +  minutos + "':" + segundos + "''");
     doc.text(35, 151.5+20, 'Fecha de envio: ' + fecha);
     doc.text(35, 151.5+30, 'Calificación: ' + getGrade());
     doc.text(35, 151.5+40, 'Intentos: ' + intentosFinalValidado);
 
     if(getGrade() >= 6){
         doc.text(35, 151.5+50, 'Estado: ' + 'Aprobado');
     }else{
         doc.text(35, 151.5+50, 'Estado: ' + 'Sigue intentando');
     }
 
     /////////////////////////////////////////
     //Iconos para cada uno de los resultados
     /////////////////////////////////////////
     
     //Para las iconos de respuestas correctas
     let iconoNombre = 'data:image/png;base64,';
     doc.addImage(iconoNombre, 'png', 20, 115, 9,9);
 
     let iconoGrupo = 'data:image/png;base64,';
     doc.addImage(iconoGrupo, 'png', 20, 125, 9,9);
 
     let iconoPreguntasCorrectas = 'data:image/png;base64,';
     doc.addImage(iconoPreguntasCorrectas, 'png', 20, 145, 9,9);
 
     //Para los iconos del tiempo de respuesta
     let iconoTiempoRespuesta = 'data:image/png;base64,';
     doc.addImage(iconoTiempoRespuesta, 'png', 20, 145+10, 9,9);
 
     //Para los iconos de las fechas
     let iconoFechaEnvio = 'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAADAAAAAwCAQAAAD9CzEMAAAAdUlEQVRYhe3XOw6AIBAE0LmHXh9uBhWeQWOidhD2Z4yZmRb2FTQL8N/sV73OEZgduyKjPpekrUhYxuM39fC7bURk8/izqQ8UF6D0AeGDye8TmAasJWAHtCHgD4gekAABAh8FpCFA4IXlN3x9D/+AhH+hGEaTA3674jG3YD03AAAAAElFTkSuQmCC';
     doc.addImage(iconoFechaEnvio, 'png', 20, 145+20, 9,9);
 
     //Para los iconos de la calificacion
     let iconoCalificacion = 'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAADAAAAAwCAQAAAD9CzEMAAAAOUlEQVRYw+3TIQ4AMAgEQf7/6dagGlRzhmSmCtM1UAXMTr/fWSAXiH8sYE3dgYA7WB2IExAQEAAeF6LcbqDQieQHAAAAAElFTkSuQmCC';
     doc.addImage(iconoCalificacion, 'png', 20, 145+30, 9,9);
 
     //Para el icono de los intentos
     let iconoIntentos = 'data:image/png;base64,';
     doc.addImage(iconoIntentos, 'png', 20, 145+40, 9,9);
 
     //Para lo iconos de aprobacion
     let iconoAprobado = "data:image/png;base64,";
     let iconoReprobado = "data:image/png;base64,";
     if(getGrade() >= 6){
         doc.addImage(iconoAprobado, 'png', 20, 145+50, 9,9);
     }else{
         doc.addImage(iconoReprobado, 'png', 20, 145+50, 9,9);
     }
 
     /////////////////////////////////////////////
     //PAGINA 2,3,4
     ////////////////////////////////////////////
 
     //Obtenemos los datos para las preguntas
     let getEnunciadoPdf = document.getElementsByClassName('getEnunciadoPdf');
     let getEnunciadoNumeroPdf = document.getElementsByClassName('getEnunciadoNumeroPdf');
     let resultadoFinal = document.querySelectorAll('[resultadoFinal]');
     let respuestaCorrectaFinal = document.querySelectorAll('[cajaRetroalimentacion]');
 
     function imprimirLasPreguntasPorHoja(primeroIndex,segundoIndex){
         //Esta función es para crear los elementos básicos del PDF
         function crearContenidosPreguntasPdf(){
             doc.addPage();
             encabezado(); //encabezado de las páginas
 
             //Rectangulo para el contenido del esta sección
             doc.setDrawColor(0);
             doc.setFillColor(225,225,225);
             doc.roundedRect(10, 45, 195, 30*7.5, 5, 5, 'F');
             
             //Rectangulo para el titulo
             doc.setDrawColor(0);
             doc.setFillColor(210,210,210);
             doc.roundedRect(10, 45, 195, 25, 5, 5, 'F');
             
             //Titulo de la sección
             doc.setTextColor(70,70,70);
             doc.setFontSize(20);
             doc.setFontType("bold");
             doc.text(35, 60, 'Resultado de preguntas');
 
             //Icono para el titulo
             doc.addImage(iconoSeccionResultados, 'png', 20, 52, 12, 12);
         }
 
 
         let posicionRectangulo = 75;
         let posicionEnunciado = 83;
         let posicionRespuesta = 98;
         let posicionRespuestaCorrecta = 102;
         let estadoRespuesta = 93;
 
         for(var i = primeroIndex; i < segundoIndex; i++){
 
             function insertQuestions(index){
                 //Rectangulo para preguntas del cuestionario
                 doc.setDrawColor(0);
                 doc.setFillColor(245,245,245);
                 doc.roundedRect(15, posicionRectangulo, 185, 30, 5, 5, 'F');
             
                 ///////////////////////////////////////////////
                 //Preguntas
                 doc.setFontSize(11);
                 doc.setTextColor(0,0,0);
                 doc.setFontType("bold");
 
                 var textLong = `${getEnunciadoNumeroPdf[index].textContent}: ${getEnunciadoPdf[index].textContent}`;
                 var splitText = doc.splitTextToSize(textLong, 175);
                 doc.text(20, posicionEnunciado, splitText);
 
                 doc.setFontSize(10);
                 doc.setTextColor(0, 0, 0);
                 doc.setFontType("normal");
                 doc.text(20, posicionRespuesta, 'Su respuesta: ' + `${resultadoFinal[index].getAttribute('resultadoFinal')}`);
                 doc.text(20, posicionRespuestaCorrecta, 'Retroalimentación = ' + `${respuestaCorrectaFinal[index].textContent}`);
 
                 doc.setFontSize(20);
                 doc.setTextColor(0, 0, 0);
                 doc.setFontType("normal");
                 if((respuestaCorrectaFinal[index].textContent).indexOf('Correcto') != -1){
                     doc.addImage(iconoAprobado, 'png', 188, estadoRespuesta, 9,9);
                 }else{
                     doc.addImage(iconoReprobado, 'png', 188, estadoRespuesta, 9,9);
                 }
                 
 
                 posicionRectangulo += 32;
                 posicionEnunciado += 32;
                 posicionRespuesta += 32;
                 posicionRespuestaCorrecta += 32;
                 estadoRespuesta += 32;
             }
 
             if(i == primeroIndex){
                 crearContenidosPreguntasPdf();
             }
             insertQuestions(i);
         }
 
         posicionRectangulo = 75;
         posicionEnunciado = 83;
         posicionRespuesta = 98;
         posicionRespuestaCorrecta = 102;
         estadoRespuesta = 93;
     }
 
     //Pag 2
     imprimirLasPreguntasPorHoja(0,6);
     //Pag 3
     imprimirLasPreguntasPorHoja(6,12);
     //Pag 4
     imprimirLasPreguntasPorHoja(12,18);
 
     /////////////////////////////////////////////
     //PAGINA 5
     ////////////////////////////////////////////
 
     function imprimirLasPreguntasPorHojaDragDrop(indexNumeroPregunta, indexRetroalimentacion){
         //Esta función es para crear los elementos básicos del PDF
         function crearContenidosPreguntasPdf(indexNumeroPregunta, indexRetroalimentacion){
             doc.addPage();
             encabezado(); //encabezado de las páginas
 
             //Rectangulo para el contenido del esta sección
             doc.setDrawColor(0);
             doc.setFillColor(225,225,225);
             doc.roundedRect(10, 45, 195, 30*7.5, 5, 5, 'F');
             
             //Rectangulo para el titulo
             doc.setDrawColor(0);
             doc.setFillColor(210,210,210);
             doc.roundedRect(10, 45, 195, 25, 5, 5, 'F');
             
             //Titulo de la sección
             doc.setTextColor(70,70,70);
             doc.setFontSize(20);
             doc.setFontType("bold");
             doc.text(35, 60, 'Relación correcta');
 
             //Icono para el titulo
             doc.addImage(iconoSeccionResultados, 'png', 20, 52, 12, 12);
 
             //Icono de la flecha de relación de concepto con definicion
             let iconRight = 'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAADAAAAAwCAQAAAD9CzEMAAAAY0lEQVRYw+3Uuw2AQAwE0SmKT2sESEYUDHRgEkJCFvl0O873JacD51zfBaGdT1JHLORzImLgUBMjp4kixPQHcamJuQSRH16ogVeiKSCae0ee93yP87Cqv2fYtfMAm3beOVenG/m2EqQg70+XAAAAAElFTkSuQmCC';
             
             //Rectangulo para preguntas del cuestionario
             let adjustHeightSquare = 75;
             for(var i = 0; i < 4; i++){
 
                 //Definiciones
                 doc.setDrawColor(0);
                 doc.setFillColor(245,245,245);
                 doc.roundedRect(15, adjustHeightSquare, 100, 42, 5, 5, 'F');
 
                 doc.setFontSize(12);
                 doc.setTextColor(0, 0, 0);
                 doc.setFontType("normal");
                 var splitText = doc.splitTextToSize('Definición: ' + `${arrayDragAndDropPDFRespuestas[indexNumeroPregunta][i+4]}`, 90);
                 doc.text(20, adjustHeightSquare + 8, splitText);
 
                 //Conceptos
                 doc.setDrawColor(0);
                 doc.setFillColor(245,245,245);
                 doc.roundedRect(120, adjustHeightSquare, 80, 42, 5, 5, 'F');
 
                 doc.setFontSize(13);
                 doc.setTextColor(0, 0, 0);
                 doc.setFontType("normal");
                 doc.text(125, adjustHeightSquare + 8, `${arrayDragAndDropPDFRespuestas[indexNumeroPregunta][i]}`);
 
                 //Iconos
                 doc.addImage(iconRight, 'png', 114.5, adjustHeightSquare + 20, 8,8);
 
                 
                 adjustHeightSquare += 44;
             }
             
             //Cuadro final de calificaciones
             doc.setDrawColor(0);
             doc.setFillColor(245,245,245);
             doc.roundedRect(15, 251, 185, 15, 4, 4, 'F');
             
             //Calificación final
             doc.text(20, 260, 'Puntos = ' + `${respuestaCorrectaFinal[indexRetroalimentacion].textContent}`);
 
         }
 
         crearContenidosPreguntasPdf(0,18);
         crearContenidosPreguntasPdf(1,19);
     }
 
     //Pag 2
     imprimirLasPreguntasPorHojaDragDrop();
 
     doc.save(tituloUnidadArchivoFinal + '.pdf');
}
